window.bookSummaryJSON = "<p><b>Worlds will collide and fates will be rewritten in the thrilling conclusion to the Devoured Worlds space opera trilogy by award‑winning author Megan E. O’Keefe.</b><br> <br> Naira and Tarquin have found a new home on Seventh Cradle. But the peace they’ve built is short-lived as mysterious assailants ambush the settlement and Naira is haunted by visions of a monstrous future. Catastrophe strikes when Tarquin uncovers a plot to bring about the end of the universe. As humanity races against the clock to prevent their extinction, old secrets come to light and loyalties fracture, and Naira realizes she may be the key to saving the world—or ending it.<br> <br> <b>The Devoured Worlds</b><br> <i>The Blighted Stars<br> The Fractured Dark<br> The Bound Worlds</i><br> <br> For more from Megan E. O'Keefe, check out:<br> <br> <b>The Protectorate </b><br> <i>Velocity Weapon</i><br> <i>Chaos Vector<br> Catalyst Gate</i></p>"; 
